Each created packet must implement the Packet class. ID First and foremost, a packet needs a unique ID, which cannot exceed the length of a uint8_t. This ID must be set using the herited Packet constructor. class ExamplePacket : public Packet {
public: ExamplePacket(uint32_t uuid=0) : Packet(PacketId::S_AUTHENTICATION_PACKET) { this->uuid = uuid; }
}; /!: DO NOT USE A SAME ID FOR TWO PACKETS, IT IS AN UNDEFINED BEHAVIOR. You are free to set a custom constructor for each of your packets. However, you MUST ensure your packet can be instantiated without any constructor arguments. Serialisation & Unserialisation A packet is supposed to send one or multiple datas as a single packet. Therefore, you NEED to implement the two following methods: void serialize() { /* Serialisation code goes here */
} void unserialize() { /* Unerialisation code goes here */
} serialize() is the function called to send the packet . On the other hand, unserialize is the function being called to turn a serialised binary data into the original Packet If the packet had to send in order: An integer, called meow. A double, called woof Yet another integer, called uwu This is how the serialize() function MUST be implemented: class ExamplePacket : public Packet {
public: /* [...] Constructor with Packet's ID definition */ void serialize() { this->write(meow); this->write(woof); this->write(uwu); }
private: int meow = 69; double woof = 727.420; int uwu = 67;
}; The write function is a pre-implemented Packet method and allows for data types to be easily written. As a result, our packet upon sending, will send in order the value of meow, woof, then finally uwu. However, if our packet can be sent, it still can not be converted back into our original packet as we did not implement the unserialise() method. This is how the unserialise() function MUST be implemented: class ExamplePacket : public Packet {
public: /* [...] Constructor with Packet's ID definition */ void serialize() { this->write(meow); this->write(woof); this->write(uwu); } void unserialize() { this->read(meow); this->read(woof); this->read(uwu); }
private: int meow = 69; double woof = 727.420; int uwu = 67;
}; The read function is a pre-implemented Packet method and allows for data types to be easily read. As a result, our packet upon receiving, will read in order the value of meow, woof, then finally uwu, which MUST be in the same order that they were serialized . meow, woof and uwu's value will then be set to their corresponding received values. Size This is one of the two's biggest RéseauType's flaw, and will be updated very soon. Each packet must declare its data size manually in a getSize() const function If we had to take our previous example, its size would be sizeof(int) + sizeof(double) + sizeof(int) which is sizeof(int) * 2 + sizeof(double) Thus, our packet getSize() function would have to be implemented as: int getSize() const { return (int) sizeof(int) * 2 + sizeof(double);
} Name This only serves for the Logger and as an identifier for the user. Each packet must specify its packet name by implementing the following method: const std::string getName() { return "ExamplePacket";
} Mode This indicates if the packet should be sent using TCP or UDP to the target. enum PacketMode getMode() const { return PacketMode::TCP;
} or enum PacketMode getMode() const { return PacketMode::UDP;
} Display This is also something that needs to change and will be soon discarded. Each packet needs to implement a display method and displays all of its value inside for the logger to display them. If we had to take our ExamplePacket, this would be a way to implement that method: void display() { std::cout << "meow=" << this->meow << ", woof=" << this->woof << ", uwu=" << this->uwu;
} which would print all of the received values. Clone This is a repetitive method that should be implemented in every packet as a way for the user to be able to clone a packet if needed. std::shared_ptr<Packet> clone() const { return make_copy(ExamplePacket);
} simply return make_copy and use as a parameter the class name of the Packet.

